const Page = () => {

    const location = useLocation();
    const { dados } = location.state;
    return (

        <ContainerPage>

            <TittlePage>
                    <div className="wc-text">Olá!<br /> Seja Bem-vindo(a) à plataforma de eventos da empresa!<br />Aqui, você vai
                    encontrar inúmeros eventos para participar,<br />dentre eles estão palestras, mentorias, workshops e etc.<br />Mas
                    primeiro, nos diga quais as suas principais áreas de interesse,<br />Aqui você pode incluir tudo se preferir:</div>                 
            </TittlePage>

        </ContainerPage>

    );
}

export default Page;
